import { Card } from "react-bootstrap";

function Educard(p) {
    return (<>

        <div className="col-md-3 educard" >
            <Card className="card">
                <Card.Body>
                    <p className="text-center">{p.date}</p>
                    <Card.Title className="text-center">{p.title}</Card.Title>
                    <Card.Subtitle className="text-center">{p.subtitle}</Card.Subtitle>

                    <Card.Text className="text-center">
                        {p.para}
                    </Card.Text>

                </Card.Body>
            </Card>

        </div>






    </>);
}

export default Educard;
